import React from "react";
import { Link, Outlet } from "react-router-dom";
import "../index.css"; // Keep this if you use custom styles

function CustomerMain() {
  return (
    <div className="container my-4">
      <div className="bg-secondary text-white p-4 rounded shadow">
        <h2 className="text-center mb-4">Customer Panel</h2>

        {/* Navigation Links */}
        <nav className="mb-3">
          <ul className="nav justify-content-center">
            <li className="nav-item">
              <Link to="/customermain/customerlogin" className="nav-link text-white">
                Login
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/customermain/customerreg" className="nav-link text-white">
                Registration
              </Link>
            </li>
          </ul>
        </nav>

        {/* Child route component will render here */}
        <div className="mt-4">
          <Outlet />
        </div>
      </div>
    </div>
  );
}

export default CustomerMain;


